import './landing.scss';
import { useState, useEffect, useRef } from 'react';
import Header from '../header/header';
import Footer from '../footer/footer';
import PhoneRight from '../phoneRight/phoneRight';
import { Link } from 'react-router-dom';
import PcWindow from '../pcWindow/pcWindow';
import Scroll from '../scroll/scroll';
import Intro from '../intro/intro';

const Landing = (): JSX.Element => {

    const refMiddle = useRef<HTMLDivElement>(null);
    const refEnding = useRef<HTMLDivElement>(null);


    const [activeBegin, setActiveBegin] = useState<boolean>(false);
    const [activeMiddle, setActiveMiddle] = useState<boolean>(false);
    const [activeEnding, setActiveEnding] = useState<boolean>(false);
    const [intro] = useState<boolean>(!sessionStorage.getItem("intro") ? true : false);


    const messageScreen: JSX.Element = <div className={`landing__middle__phoneWrapper__messageWrapper ${activeMiddle ? "landing__middle__phoneWrapper__messageWrapper--active" : ""}`}><span>Help?</span></div>;

    useEffect(() => {

        if (intro) {
            sessionStorage.setItem("intro", JSON.stringify(intro));
        }

        window.addEventListener('scroll', scrollHandler);

        return () => window.removeEventListener('scroll', scrollHandler);

    }, [intro]);

    const scrollHandler = () => {
        setActiveBegin(true);
        if (refMiddle && refMiddle.current && window.pageYOffset + window.innerHeight / 2 >= refMiddle.current.offsetTop) {
            setActiveMiddle(true);
        }
        if (refEnding && refEnding.current && window.pageYOffset + window.innerHeight / 2 >= refEnding.current.offsetTop) {
            setActiveEnding(true);
        }
    }

    return (
        <>
            {intro && <Intro />}
            <Header dark={false} />
            <div className="landing">
                <div className="landing__begin" onMouseEnter={() => setActiveBegin(true)}>
                    <svg xmlns="http://www.w3.org/2000/svg" height="100vh" width="100vw" viewBox="0 0 500 246"
                        preserveAspectRatio="xMinYMid meet">
                        <defs>
                            <pattern id="titlePattern" x="0" y="0" patternUnits="userSpaceOnUse" width="500" height="246"
                                viewBox="0 0 500 246">
                                <text x="0" y="71">Design</text>
                                <text x="0" y="153">Build</text>
                                <text x="0" y="235">Maintain</text>
                            </pattern>
                        </defs>
                        <g className="title" fill="url(#titlePattern)">
                            <rect className={`${activeBegin ? "title__odd--explode" : "title__odd"}`} x="0" y="0" width="500" height="42" />
                            <rect  x="0" y="41" width="500" height="42" />
                            <rect className={`${activeBegin ? "title__odd--explode" : "title__odd"}`} x="0" y="81" width="500" height="42" />
                            <rect  x="0" y="122" width="500" height="42" />
                            <rect className={`${activeBegin ? "title__odd--explode" : "title__odd"}`} x="0" y="163" width="500" height="42" />
                            <rect  x="0" y="204" width="500" height="42" />
                        </g>
                    </svg>
                </div>
                <div className="landing__border"></div>
                <div ref={refMiddle} className={`landing__middle ${activeMiddle ? "landing__middle--active" : ""}`}>
                    <h1 className="landing__middle__title">We are a digital product studio based in the Netherlands</h1>
                    <PhoneRight classNameAdded="phoneRight--red" messageScreen={messageScreen} explode={!activeMiddle} />
                </div>
                <div className="landing__border"></div>
                <div ref={refEnding} className={`landing__ending ${activeEnding ? "landing__ending--active" : ""}`}>
                    <Link to="/services">
                        <span>Services</span>
                        <span></span>
                    </Link>
                </div>
            </div>
            <Footer />
        </>
    );
}

export default Landing;
